import React from 'react';

const user = (props) => {
  return (
    <div>
      <h1>{props.name}</h1>
      <p>Age: {props.age}</p>
      <style jsx>
          {`
            div {
                border: 1px solid #eee;
                box-shadow: 0 2
            }
          `}
      </style>
    </div>
  );
};

export default user;
